import { ChatApp } from './components/chatapp/chatbox'
import {
    BrowserRouter,
    Router,
    Switch,
    Route,
    Link,
  } from "react-router-dom";
import './app.css'
function Hello() {
    return <h1>Hello</h1>
}
function App() {
    return (
        // <ChatApp></ChatApp>
        <BrowserRouter>
            <Switch>
                <Route path = "/" component = {ChatApp} exact />
                <Route path = "/login" component = {Hello} />
            </Switch>
          
        </BrowserRouter>
       
    )
}

export {App}
